import React from "react";
import Moment from "react-moment";
import "moment-timezone";

export default function FormattedDate(props) {
  let days = ["Sun", "Mon", "Tues", "Weds", "Thurs", "Fri", "Sat"];
  let day = days[props.date.getDay()];
  return (
    <div>
      {day}
    </div>
  );}
